import React, { useEffect } from 'react';
import AOS from 'aos'; // Import AOS
import 'aos/dist/aos.css'; // Import AOS CSS for styling

const LastMessage = () => {
  useEffect(() => {
       AOS.init();
  }, []);

  return (
    <div className="last-message" data-aos="fade-up">
      <p>It's not over; we will make more wonderful moments in the future.</p>
    </div>
  );
};

export default LastMessage;
